import React from "react";
import Project from './Project.js';

class Projects extends React.Component {
  render() {
      const items = [];
      let nomes = this.props.projectNames;
      for (let i = 0; i < 4; i++) {
        items.push(<li>{nomes[i]}</li>)
      }

      return(
        <div id="projects">
        {items}

        </div>
      )
  }
}


export default Projects
